import React, { useState } from "react";
import axios from "axios"; // Axios is used for API requests.

const Checkout = ({ cartItems, setCartItems }) => {
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [orderSuccess, setOrderSuccess] = useState(false);

  // Calculate total price
  const totalPrice = cartItems.reduce((total, item) => total + item.price, 0);

  // Handle order submission
  const placeOrder = async () => {
    if (cartItems.length === 0) {
      alert("Your cart is empty!");
      return;
    }

    const orderData = {
      customer: {
        name: "Bechu Kumar Pandit",
        address: "Bhoil-18, JanakpurDham, Kapileshwar 16",
        phone: "9873498153",
        email: "pandit.bechu@gmail.com",
      },
      items: cartItems,
      total: totalPrice,
      paymentMethod: "Cash on delivery", 
    };

    try {
      setIsSubmitting(true);
      const response = await axios.post("https://your-api-endpoint.com/orders", orderData);
      console.log("Order Response:", response.data);
      setOrderSuccess(true);
      setCartItems([]); // Clear the cart after successful order.
    } catch (error) {
      console.error("Order submission failed:", error);
      alert("Failed to place the order. Please try again.");
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <div style={{ padding: "20px" }}>
      <h3>Checkout</h3>

      {/* Billing Details */}
      <div
        style={{
          border: "1px solid #ccc",
          padding: "15px",
          borderRadius: "5px",
          marginBottom: "20px",
        }}
      >
        <h4>Billing Details</h4>
        <p><strong>Bechu Kumar Pandit</strong></p>
        <p>Bhoil-18, JanakpurDham, Kapileshwar 16</p>
        <p>Phone Number: 9873498153</p>
        <p>Email Address: pandit.bechu@gmail.com</p>
      </div>

      {/* Order Summary */}
      <div>
        <h4>Your Order</h4>
        {cartItems.length > 0 ? (
          <>
            {cartItems.map((item) => (
              <div
                key={item.id}
                style={{
                  display: "flex",
                  justifyContent: "space-between",
                  padding: "10px",
                  border: "1px solid #ccc",
                  borderRadius: "5px",
                  marginBottom: "10px",
                }}
              >
                <div>
                  <p>{item.name}</p>
                  <p>Price: Rs.{item.price}</p>
                </div>
              </div>
            ))}

            {/* Total Section */}
            <div
              style={{
                display: "flex",
                justifyContent: "space-between",
                marginTop: "20px",
                fontWeight: "bold",
              }}
            >
              <span>Total:</span>
              <span>Rs.{totalPrice}</span>
            </div>
          </>
        ) : (
          <p>Your cart is empty.</p>
        )}
      </div>

      {/* Payment Options */}
      <div style={{ marginTop: "20px" }}>
        <h4>Payment Options</h4>
        <label>
          <input
            type="radio"
            name="payment"
            value="cod"
            style={{ marginRight: "10px" }}
          />
          Cash on delivery
        </label>
        <br />
        <label>
          <input
            type="radio"
            name="payment"
            value="card"
            style={{ marginRight: "10px" }}
          />
          Card
        </label>
      </div>

      {/* Terms and Place Order */}
      <div style={{ marginTop: "20px" }}>
        <label>
          <input type="checkbox" style={{ marginRight: "10px" }} />
          I have read and agree to the website{" "}
          <a href="#" style={{ color: "#007bff" }}>
            terms and conditions
          </a>
        </label>
      </div>

      <button
        onClick={placeOrder}
        disabled={isSubmitting}
        style={{
          marginTop: "20px",
          padding: "10px 15px",
          backgroundColor: isSubmitting ? "#6c757d" : "#28a745",
          color: "#fff",
          border: "none",
          borderRadius: "5px",
          cursor: "pointer",
          width: "100%",
        }}
      >
        {isSubmitting ? "Placing Order..." : "Place Order"}
      </button>

      {/* Success Message */}
      {orderSuccess && (
        <p style={{ color: "green", marginTop: "20px" }}>
          Your order has been placed successfully!
        </p>
      )}
    </div>
  );
};

export default Checkout;
